import React, {useEffect, useState} from 'react';
import './styles.css'
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import api from '../services/api';

const useStyles = makeStyles((theme) => ({
    root: {
      '& > *': {
        margin: theme.spacing(1),
        width: '40ch',
      },
    },
  }));


export default function Artists(){
    const classes = useStyles();

    const [artist, setArtist] = useState('')
    console.log(artist)

async function handleSearchArtist(event){
    event.preventDefault()
    const response = await api.post('artist/create', {name: artist}) 
    console.log(response)
}
    return(
        <>

            <div className="search" >
                <form onSubmit={handleSearchArtist} className={classes.root} noValidate autoComplete="off"> 
                     <TextField id="standard-basic" label="Busque um artista" 
                     onChange={(event)=>setArtist(event.target.value)}
                     value={artist}
                     />
                </form>
            </div>

            <div className="list-artist">
                <ul>
                    <li>

                    </li>
                </ul>
            </div>

        </>
    )

}
